import React from "react";
import img from "../img/milky-way.jpg";

function Header() {
  return (
    <header
      className="bg-cover bg-center h-screen  mb-32"
      style={{ backgroundImage: `url(${img})` }}
    >
      <div className="h-56 px-64 flex justify-between items-center">
        <h3>THIS IS THE FOOTER</h3>
        <h3>THIS IS THE FOOTER</h3>
      </div>

      <div className="inline-block w-1/4 ml-64 mt-40">
        <h1 className="text-6xl font-semibold leading-tight mb-5">
          Welcome to your Space Portal.
        </h1>
        <h3 className="text-2xl font-light leading-snug mb-8">
          A magnificent window to the universe. Discover images, news and facts
          about the galaxy and beyond.
        </h3>
        <span className="text-base">Powered by Nasa API</span>
      </div>
      {/* <Nav /> */}
    </header>
  );
}

export default Header;
